import React, { useState } from "react";
import { Button } from "@mui/material";
import { useSelector, useDispatch } from "react-redux";
import { AiFillDelete, AiFillEdit } from "react-icons/ai";
import { FcPlus } from "react-icons/fc";
import { Changename } from "../redux/action/action";
const Projectshow = () => {
  const data = useSelector((state) => state.rootReducer.data);
  const dispatch = useDispatch();
  // const [name, setname] = useState({
  //   projname: "",
  //   id: null,
  // });
  const [user, setUser] = useState({
    projname: "",
    id: 0,
  });

  const save = (e) => {
    e.preventDefault();
    console.log(user);
    dispatch(Changename(user.projname, user.id));
  };
  const edit = (val) => {
    console.log(val);
    console.log(user);
    setUser({ projname: val.name, id: val.id });
  };

  return (
    <div>
      <br />
      <h1 style={{ color: "white" }}>Projects</h1>
      <div className="box">
        <br />
        <h2>Projects</h2>
        <br />
        <div className="box2">
          <input
            type={"text"}
            placeholder="Enter Project Name"
            className="bold"
            value={user.projname}
            onChange={(e) => setUser({ projname: e.target.value })}
          />
          &nbsp;&nbsp;
          <Button variant="contained" color="warning" onClick={(e) => save(e)}>
            Save
          </Button>
          <br />
          <br />
          <hr />
          <div className="over">
            {data.map((value, index) => {
              return (
                <div key={index} className="prj">
                  {value.id})&nbsp;
                  {value.name}
                  <AiFillEdit
                    style={{ marginLeft: "50%" }}
                    onClick={() => edit(value)}
                  />
                  <AiFillDelete style={{ color: "red", marginLeft: "5%" }} />
                </div>
              );
            })}
            <input type="text" id="position" placeholder="Add A Project Name" />
            <FcPlus id="fix" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Projectshow;
